const homeRouter = ()=> {

    const gettingdata = ()=>{
        fetch("http://192.168.1.247:3001/api/user/home", {
            method:"GET", 
            mode:"no-cors"
        }).then((response)=>{
            console.log(response)
        }).catch(err=>{
            console.log("1: ", err)
        })
    }

    return (
        <>
            <h1>this is the home page from home file</h1>
            {gettingdata()}
        </>
        );
}

export default homeRouter;
